import { BrowserRouter, Routes, Route } from "react-router-dom";
import ScaleSettings from "./components/nps-setting/ScaleSettings";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/">
            <Route index element={<ScaleSettings />} />
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}
export default App;
